INSERT INTO `books` (`BookID`, `BookTitle`, `FrontCover`, `Author`, `GenreID`, `Genre`, `PublishedDate`, `Ratings`, `Abstract`) VALUES
(1, 'Virtual Light', , 'William Gibson', 1, 'Science Fiction', 1993, '★★★★★', 'As in his previous novels, Gibson\'s plot is straightforward. Chevette Washington, a bicycle courier, impulsively steals a pair of ``virtual light\'\' glasses that feed images directly to the optic nerve, not realizing that it contains precious secret data that its owners will stop at nothing to recover. Rent-a-cop Berry Rydell loses his job due to a hacker\'s prank, so he teams up with Lucius Warbaby to track the stolen shades, only slowly realizing that Warbaby and his former employers are tied in with the evil corporate scheme revealed by the glasses.');
INSERT INTO `books` (`BookID`, `BookTitle`, `FrontCover`, `Author`, `GenreID`, `Genre`, `PublishedDate`, `Ratings`, `Abstract`) VALUES
(2, 'Higher Education', , 'Charles Sheffield', 1, 'Science Fiction', 1986, '★★★☆☆', 'A future dystopian Earth where the United States has become a woefully inefficient bureaucratized nation. The public school system is primarily interested in promoting self-esteem rather than learning. For example, the vast majority of public high school graduates are illiterate and end up in \"the pool\"; an endless crowd of unemployable youths depending on government assistance or crime for survival. The book is told from the perspective of the main character, a high school student named Rick who quickly finds himself expelled after a practical joke goes wrong.');
INSERT INTO `books` (`BookID`, `BookTitle`, `FrontCover`, `Author`, `GenreID`, `Genre`, `PublishedDate`, `Ratings`, `Abstract`) VALUES
(3, 'The Quiet Pools', , 'Michael P. Kube-McDowell', 1, 'Science Fiction', 1990, '★★★★☆', 'Controversy arises over the Diaspora Project, a program designed to carry ten thousand men and women to a new life outside the solar system, and the Homeworld movement, led by the mysterious Jeremiah, threatens to stop it no matter what the cost.');
INSERT INTO `books` (`BookID`, `BookTitle`, `FrontCover`, `Author`, `GenreID`, `Genre`, `PublishedDate`, `Ratings`, `Abstract`) VALUES
(4, 'Trouble with Aliens', , 'Christopher Anvil', 1, 'Science Fiction', 2006, '★★★☆☆', 'Humans on the space frontiers may have enough problems with befuddled bureaucrats, rules that don\'t fit the realities of very dangerous situations, and general rear-echelon incompetence without bringing in unfriendly aliens, but it\'s that kind of universe. On the other hand, as master satirist Christopher Anvil makes clear, the aliens are anything but omnipotent and have plenty of problems of their own. Here for the first time the stories and short novels of the war with the Outs are collected into a novel-length chronicle. The Outs had mental powers they could use to make humans see illusions and convince them to change sides. They were unbeatable until some troublesome humans found their Achille\'s heel. These and other stories of human/alien conflict fill this large volume by the master of wryly sardonic science fiction adventure.');
INSERT INTO `books` (`BookID`, `BookTitle`, `FrontCover`, `Author`, `GenreID`, `Genre`, `PublishedDate`, `Ratings`, `Abstract`) VALUES
(5, 'The Snow Queen', , 'Joan D. Vinge', 1, 'Science Fiction', 1980, '★★☆☆☆', 'The imperious Winter colonists have ruled the planet Tiamat for 150 years, deriving wealth from the slaughter of the sea mers. But soon the galactic stargate will close, isolating Tiamat, and the 150-year reign of the Summer primitives will begin. Their only chance at surviving the change is if Arienrhod, the ageless, corrupt Snow Queen, can destroy destiny with an act of genocide. Arienrhod is not without competition as Moon, a young Summer-tribe sibyl, and the nemesis of the Snow Queen, battles to break a conspiracy that spans space.');
INSERT INTO `books` (`BookID`, `BookTitle`, `FrontCover`, `Author`, `GenreID`, `Genre`, `PublishedDate`, `Ratings`, `Abstract`) VALUES
(6, 'Give Your English the Winning Edge', , 'Jose A. Carillo', 2, 'Educational', 2009, '★★★★★', 'The 486-page volume by the National Book Award-winning author discusses the various mechanisms and tools of English for combining words and ideas into clear, logical, and engaging writing. It shows how the various connectives—the conjunctions, the conjunctive adverbs, and the prepositions—establish the six basic logical relationships in language, then demonstrates how to make them work with the various other grammar elements to form more effective, convincing, and readable expositions.');
INSERT INTO `books` (`BookID`, `BookTitle`, `FrontCover`, `Author`, `GenreID`, `Genre`, `PublishedDate`, `Ratings`, `Abstract`) VALUES
(7, 'Sulyap Kultura: Second Quarter', , 'Michael Charleston Chua', 2, 'Educational', 1996, '★★★★☆', 'The “Sulyap Kultura” journal, specifically the second quarter of 1996, featured an article titled “Andres Bonifacio and the 1896 Revolution” by Milagros C. Guerrero, Emmanuel N. Encarnacion, and Ramon N. Villegas.');
INSERT INTO `books` (`BookID`, `BookTitle`, `FrontCover`, `Author`, `GenreID`, `Genre`, `PublishedDate`, `Ratings`, `Abstract`) VALUES
(8, 'Keys to Critical Reading and Writing 1', , 'Sterling Plata', 2, 'Educational', 2005, '★★☆☆☆', 'Keys to Critical Reading and Writing 1: English Proficiency and Personal Leadership Workbook for College Success” by Sterling Plata integrates study skills, academic reading and writing skills, and critical thinking. Here are some essential strategies for critical reading. These skills are valuable not only for academic success but also for personal growth and leadership.');
INSERT INTO `books` (`BookID`, `BookTitle`, `FrontCover`, `Author`, `GenreID`, `Genre`, `PublishedDate`, `Ratings`, `Abstract`) VALUES
(9, 'Biology: Science of Life', , 'Collen Belk', 2, 'Educational', 2012, '★☆☆☆☆', 'A compelling textbook that engages students in the fascinating world of biology.');
INSERT INTO `books` (`BookID`, `BookTitle`, `FrontCover`, `Author`, `GenreID`, `Genre`, `PublishedDate`, `Ratings`, `Abstract`) VALUES
(10, 'MSA Comprehensive English Handbook', , 'Clarissa Rivero-Hernandez', 2, 'Educational', 2010, '★★★★★', 'The MSA Comprehensive English Handbook is a reference intended for all those who wish to have a firm grounding in English grammar and usage. It is a must-have for students from grade school to college and for professionals who aim to increase their English proficiency.\r\nThe book presents each topic in a simplified manner. It provides easy-to-grasp explanations, examples, and illustrations on the different parts of speech, the different parts of the sentence, capitalization, and punctuation usage. Furthermore, it provides pointers on how to identify errors in sentences and increase vocabulary. It also gives background information on literature and on figures of speech. And, for quick reference, an appendix, a glossary, and an index are provided.\r\nWith the MSA Comprehensive English Handbook, students will now have an excellent supplement to lessons, assignments, periodical and qualifying exams. Professionals also have an effective aid in writing requirements and in preparation for local ');
INSERT INTO `books` (`BookID`, `BookTitle`, `FrontCover`, `Author`, `GenreID`, `Genre`, `PublishedDate`, `Ratings`, `Abstract`) VALUES
(11, 'A Country Not Even His Own', , 'Steve E. Psinakis', 3, 'Politics', 2008, '★★★★★', 'More than a second book about the end of the Marcos dictatorship, A Country Not Even His Own by Steve Psinakis records the author\'s odyssey from the events that inspired him to champion democracy in the Philippines to the subsequent US reaction: United States of America versus Steve Elias Psinakis. From Greece with an American electrical engineering degree, Mr. Psinakis found employment and met his wife-to-be, Presy Lopez, in Manila. As the Production Manager of Meralco stationed in Manila, employment inequities between Americans and Filipinos were soon to become evident. In 1972 human rights abuse would yet strike at the heart of his wife\'s family with the political imprisonment of her brother, Gery Lopez. Abroad in the United States, Mr. Psinakis helped to orchestrate the successful escape of his brother-in-law and took a leading role in exposing the abuses of the Marcos regime. The book title is quoted from a 1988 citation by President Cory Aquino to Mr. Psinakis in recognition of h');
INSERT INTO `books` (`BookID`, `BookTitle`, `FrontCover`, `Author`, `GenreID`, `Genre`, `PublishedDate`, `Ratings`, `Abstract`) VALUES
(12, 'Between Fires: Fifteen Perspective on the Estrada Crisis ', , 'Amando Doronila', 3, 'Politics', 2002, '★★★★☆', 'A collection of 15 essays that delve into the sociological, political, and economic aspects of the events leading to the fall of President Joseph Estrada. These essays provide depth and context to the controversial affair.');
INSERT INTO `books` (`BookID`, `BookTitle`, `FrontCover`, `Author`, `GenreID`, `Genre`, `PublishedDate`, `Ratings`, `Abstract`) VALUES
(13, 'Election in the Philippines from Pre-Colonial to the Present', , 'Clarita R. Carlos', 3, 'Politics', 1996, '★★★★★', 'The journey of Philippine elections—from tribal councils to modern-day democracy—reflects the nation’s resilience, adaptability, and commitment to representation.'),
(14, 'Political Parties in the Philippines from 1900 to the Present.', , 'Rommel C. Banlaoi', 3, 'Politics', 1996, '★★★★★', '“Political Parties in the Philippines from 1900 to the Present” is a book authored by Rommel C. Banlaoi and Clarita R. Carlos. It delves into the history of political parties in the Philippines, spanning from 1900 to the present. The book provides insights into the evolution, ideologies, and dynamics of these parties throughout the country’s political landscape.');
INSERT INTO `books` (`BookID`, `BookTitle`, `FrontCover`, `Author`, `GenreID`, `Genre`, `PublishedDate`, `Ratings`, `Abstract`) VALUES
(15, 'Investment Priorities Plan', , 'Phil. Board of Investments', 3, 'Politics', 2010, '★★★★☆', 'The 2010 Investment Priorities Plan (IPP), approved by President Gloria M. Arroyo on April 30, 2010, outlines the areas of investment that are eligible for government incentives in the Philippines. The Board of Investments (BOI) issues this annual plan, which serves as a guide for promoting specific sectors and encouraging investment in those areas.');
INSERT INTO `books` (`BookID`, `BookTitle`, `FrontCover`, `Author`, `GenreID`, `Genre`, `PublishedDate`, `Ratings`, `Abstract`) VALUES
(16, 'Elpidio Quirino: The Judgement of History', , 'Salvador P. Lopez', 4, 'History', 1990, '★★★★★', 'Salvador P. Lopez, in his book titled “Elpidio Quirino: The Judgment of History”, provides insights into Quirino’s legacy. Published in 1990 by the President Elpidio Quirino Foundation, this work delves into Quirino’s presidency and the impact he had on the Philippines. Quirino’s tenure was marked by challenges, including post-war reconstruction, economic reforms, and political stability. His policies and decisions continue to be subjects of historical analysis and debate.');
INSERT INTO `books` (`BookID`, `BookTitle`, `FrontCover`, `Author`, `GenreID`, `Genre`, `PublishedDate`, `Ratings`, `Abstract`) VALUES
(17, 'Sipocot: At The Juncture of History', , 'Danilo Madrid Gerona', 4, 'History', 2009, '★★★★☆', 'Situated at the juncture of history. Its roots can be traced back to the time of the Spaniards when Dominican Missionaries began spreading the Catholic faith across the archipelago in 1704.');
INSERT INTO `books` (`BookID`, `BookTitle`, `FrontCover`, `Author`, `GenreID`, `Genre`, `PublishedDate`, `Ratings`, `Abstract`) VALUES
(18, 'The World: History and Civilization', , 'Teofista L. Vivar', 4, 'History', 2002, '★★★☆☆', '“The World: History and Civilization” by Teofista L. Vivar is a fascinating exploration of our global past. Let’s delve into its pages and uncover the rich tapestry of human history. This comprehensive work covers a wide range of historical topics, from ancient civilizations to modern developments. Here are some other notable works by Teofista L. Vivar.');
INSERT INTO `books` (`BookID`, `BookTitle`, `FrontCover`, `Author`, `GenreID`, `Genre`, `PublishedDate`, `Ratings`, `Abstract`) VALUES
(19, 'Jose Rizal\'s Immortal Legacy', , 'Filomena V. Rivera', 4, 'History', 1997, '★★☆☆☆', 'Jose Rizal, the national hero of the Philippines, left an indelible mark on history. His life and works continue to inspire generations.'),
(20, 'Naga: The Birth and Rebirth of a City', , 'Danilo Madrid Gerona', 4, 'History', 2009, '★★★★★', 'A comprehensive history book that delves into the fascinating story of Naga City. this paperback provides insights into the city’s origins, transformations, and enduring spirit. Gerona’s meticulous research and engaging narrative shed light on the rich heritage and evolution of Naga, making it a valuable resource for anyone interested in the city’s past and present');
INSERT INTO `books` (`BookID`, `BookTitle`, `FrontCover`, `Author`, `GenreID`, `Genre`, `PublishedDate`, `Ratings`, `Abstract`) VALUES
(21, 'Riptide', , 'Catherine Coulter', 5, 'Thriller, Mystery', 2000, '★★★★★', '\"Riptide\" is a novel written by Catherine Coulter; a bestselling author known for her romantic suspense novels. Published in 2000, this book is part of Coulter\'s FBI Thriller series.\r\nIn \"Riptide,\" Coulter combines elements of mystery, romance, and suspense as FBI agents Dillon Savich and Lacey Sherlock investigate a series of mysterious events, including a plane crash and a murder. The novel weaves together multiple plotlines, keeping readers engaged in the unfolding mysteries.\r\nCatherine Coulter\'s FBI Thriller series typically features strong, dynamic characters and intricate plots, blending romance with suspenseful elements. If you enjoy romantic thrillers with a focus on law enforcement and mystery, \"Riptide\" may be an engaging read for you.\r\n'),
(22, 'Knockout', , 'Catherine Coulter', 5, 'Thriller, Mystery', 2009, '★★★★☆', 'Seven-year-old Autumn Backman needed a hero. When she saw Special Agent Dillon Savich on TV after he\'d brought down bank robbers in a Georgetown bank, she knew she\'d found him. She called Savich, but she didn\'t use the phone.\r\n\"They were burying dead people in my daddy\'s grave ... they\'re coming after us. Please help me.\"\r\n\"Who\'s they?\"\r\n\"Blessed, he\'s coming.\"\r\nEthan Merriweather, sheriff of Titusville, Virginia, a small mountain town near the Titus Hitch Wilderness, goes looking for a missing little girl. Soon after he finds her, Ethan realizes that Autumn has brought him a huge problem - a relentless madman who can control others simply by looking at them. And the madman is after her and her mom.\r\nIt\'s Uncle Blessed, and he wants Autumn.\r\n');
INSERT INTO `books` (`BookID`, `BookTitle`, `FrontCover`, `Author`, `GenreID`, `Genre`, `PublishedDate`, `Ratings`, `Abstract`) VALUES
(23, 'Double Take', , 'Catherine Coulter', 5, 'Thriller, Mystery', 2007, '★★★☆☆', '\"Double Take\" is a romantic suspense novel written by Catherine Coulter. Published in 2007, it is part of Coulter\'s FBI Thriller series, which features recurring characters, including FBI agents Dillon Savich and Lacey Sherlock.'),
(24, 'TailSpin', , 'Catherine Coulter', 5, 'Thriller, Mystery', 2008, '★★☆☆☆', '\"Tail Spin\" is a romantic suspense novel by Catherine Coulter. Published in 2008, it is part of Coulter\'s FBI Thriller series. In this series, recurring characters FBI agents Dillon Savich and Lacey Sherlock often find themselves involved in intricate and suspenseful cases.');
INSERT INTO `books` (`BookID`, `BookTitle`, `FrontCover`, `Author`, `GenreID`, `Genre`, `PublishedDate`, `Ratings`, `Abstract`) VALUES
(25, 'Blow Out', , 'Catherine Coulter', 5, 'Thriller, Mystery', 2004, '★★★★★', 'A long weekend in the Poconos is cut short when Sherlock and Savich are helicoptered back to Washington to lead the investigation into the brutal murder of a Supreme Court justice.\r\n\r\nSavich allows Callie Markham, an investigative reporter for The Washington Post, to partner with local Metro Police liaison Ben Raven since she\'s got the inside track--she\'s the stepdaughter '),
(26, 'Drinking Coffee Elsewhere', , 'ZZ Packer', 6, 'Fiction', 2003, '★★★★★', '\"Drinking Coffee Elsewhere\" is a collection of short stories written by ZZ Packer. The book was published in 2003 and received critical acclaim for its insightful and often humorous exploration of various aspects of contemporary life, particularly the experiences of African Americans.\r\nThe stories in the collection touch on a range of themes, including race, identity, and the complexities of human relationships. One of the well-known stories in the collection is the titular \"Drinking Coffee Elsewhere,\" which follows the experiences of a young African-American woman attending an elite university.');
INSERT INTO `books` (`BookID`, `BookTitle`, `FrontCover`, `Author`, `GenreID`, `Genre`, `PublishedDate`, `Ratings`, `Abstract`) VALUES
(27, 'The Fortress of Solitude', , 'Jonathan Lethem', 6, 'Fiction', 2003, '★★★★☆', '\"The Fortress of Solitude\" is a novel written by Jonathan Lethem. Published in 2003, the novel is a coming-of-age story that spans several decades and is set in Brooklyn, New York.\r\nThe story follows the lives of two childhood friends, Dylan Ebdus and Mingus Rude, as they navigate the complexities of growing up in a racially diverse neighborhood. The novel incorporates elements of magic realism, as Dylan discovers a magical ring that grants him powers.\r\n'),
(28, 'The Rule of Four Book', , 'Ian Cadwell, Dustin Thomason', 6, 'Fiction', 2004, '★★★☆☆', '\"The Rule of Four\" is a mystery thriller novel written by Ian Caldwell and Dustin Thomason. Published in 2004, the book combines elements of historical fiction, conspiracy, and intellectual puzzle.\r\nThe novel revolves around two Princeton University students, Tom Sullivan and Paul Harris, as they delve into the mysteries surrounding a centuries-old manuscript. The manuscript, known as the Hypnerotomachia Poliphili, is an ancient Renaissance text that holds secrets and codes. As the protagonists decipher the enigmas within the manuscript, they become entangled in a dangerous and suspenseful quest.\r\n');
INSERT INTO `books` (`BookID`, `BookTitle`, `FrontCover`, `Author`, `GenreID`, `Genre`, `PublishedDate`, `Ratings`, `Abstract`) VALUES
(29, 'The New Girl', , 'Rowan McAuley', 6, 'Fiction', 2008, '★★☆☆☆', 'Zoe can\'t wait to meet Isabelle, the new girl. What will she be like, and will they be friends? No matter what, Zoe is going to make sure Isabelle feels welcome at their school.\r\nBut it turns out Isabelle has no trouble fitting in right away. And when she starts being mean, Zoe has to choose between being mean too, or standing tall and being a good friend.\r\n');
INSERT INTO `books` (`BookID`, `BookTitle`, `FrontCover`, `Author`, `GenreID`, `Genre`, `PublishedDate`, `Ratings`, `Abstract`) VALUES
(30, 'The No. 1 Ladies\' Detective Agency', , 'Alexander McCall Smith', 6, 'Fiction', 1998, '★★★★★', 'Precious Ramotswe has only just set up shop as Botswana\'s No.1 (and only) lady detective when she is hired to track down a missing husband, uncover a con man, and follow a wayward daughter. However, the case that tugs at her heart, and lands her in danger, is a missing eleven-year-old boy, who may have been snatched by witch doctors.');
