INSERT INTO `ebooks` (`ebook_id`, `ebook_title`, `front_cover`, `author`, `genre_id`, `genre`, `published_year`, `ratings`, `abstract`) VALUES
(1, 'Goliath', , 'Richard Turner', '1', 'Thriller', 2013, '★★★★☆', 'In 1931, during its maiden voyage, the British Airship Goliath mysteriously disappeared without a trace. Hidden deep inside is a secret that could change the world.\r\nPresent day, in The Philippines, an attempted kidnapping draws historian Jennifer March and former soldier Ryan Mitchell into a deadly race to find the Goliath before a mysterious figure who threatens to topple governments and the lives of millions. From Alaska to West Africa to Iceland the hunt for the truth is on.\r\n');
INSERT INTO `ebooks` (`ebook_id`, `ebook_title`, `front_cover`, `author`, `genre_id`, `genre`, `published_year`, `ratings`, `abstract`) VALUES
(2, 'Rise and Kill First', , 'Ron Bergman', '1', 'Thriller', 2018, '★★★★★', 'THE ISRAELI INTELLIGENCE COMMUNITY guards its secrets jealously. Its near-total opacity is protected by a complex array of laws and protocols, strict military censorship, and the intimidation, interrogation, and prosecution of journalists and their sources, as well as a natural solidarity and loyalty among the espionage agencies’ personnel.\r\nEfforts to persuade the Israeli defense establishment to cooperate with the research for this project went nowhere. Requests to the intelligence community that it comply with the law by transferring its historical documents to the State Archive and allowing the publication of materials fifty years old or more were met with stony silence. A petition to the Supreme Court for an order forcing compliance with the law was dragged out over years, with the complicity of the court, and ended with nothing but an amendment to the law itself: The secrecy provisions were extended from fifty to seventy years, longer than the history of the state.\r\n');
INSERT INTO `ebooks` (`ebook_id`, `ebook_title`, `front_cover`, `author`, `genre_id`, `genre`, `published_year`, `ratings`, `abstract`) VALUES
(3, 'The After House', , 'Mary Roberts Rinehart', '1', 'Thriller', 1914, '★★★★★', ' A Story of Love, Mystery, and a Private Yacht\r\nAn astonishing story of love and mystery, which equals if not surpasses in interest those other lively stories of Mrs. Rinehart\'s. The novel is one of the sprightliest of the season and will add to the author\'s reputation as an inventor of \'queer\' plots.\" — Philadelphia Record.\r\n');
INSERT INTO `ebooks` (`ebook_id`, `ebook_title`, `front_cover`, `author`, `genre_id`, `genre`, `published_year`, `ratings`, `abstract`) VALUES
(4, 'Eclipse', , 'Stephanie Meyer', '1', 'Thriller', 2007, '★★★★☆', 'Bella? ‘Edward’s soft voice came from behind me. I turned to see him spring lightly up the porch steps, his hair windblown from running. He pulled me into his arms at once and kissed me again. His kiss frightened me. There was too much tension, too strong an edge to the way his lips crushed mine - like he was afraid we had only so much time left to us.\r\nAs Seattle is ravaged by a string of mysterious killings and a malicious vampire continues her quest for revenge, Bella once again finds herself surrounded by danger. Amid it all, she is forced to choose between her love for Edward and her friendship with Jacob - knowing that her decision has the potential to ignite the ageless struggle between vampire and werewolf.\r\n');
INSERT INTO `ebooks` (`ebook_id`, `ebook_title`, `front_cover`, `author`, `genre_id`, `genre`, `published_year`, `ratings`, `abstract`) VALUES
(5, 'Man\'s Search for Meaning', , 'Victor Frankl', '1', 'Thriller', 1946, '★★★★★', 'THIS BOOK HAS NOW LIVED TO SEE nearly one hundred printings in English—in addition to having been published in twenty-one other languages. The English editions alone have sold more than three million copies.\r\nThese are the dry facts, and they may well be the reason why reporters of American newspapers and particularly of American TV stations often start their interviews, after listing these facts, by exclaiming: “Dr. Frankl, your book has become a true bestseller—how do you feel about such a success?” Whereupon I react by reporting that in the rest place I do not at all see in the bestseller status of my book an achievement and accomplishment on my part but rather an expression of the misery of our time: if hundreds of thousands of people reach out for a book whose very title promises to deal with the question of a meaning to life, it must be a question that burns under their fingernails.\r\n');
INSERT INTO `ebooks` (`ebook_id`, `ebook_title`, `front_cover`, `author`, `genre_id`, `genre`, `published_year`, `ratings`, `abstract`) VALUES
(6, 'Twilight', , 'Stephanie Meyer', '2', 'Fiction and Literature', 2005, '★★★★★', 'According to many Twilight readers, this novel has focused on a romance that is completely not common in our lives - the love between a human girl and a vampire. They fall in love with each other and decide to face all the difficulties even there may lie in the road of their future relationship.\r\nThis is positive and energetic, but the story still causes the worries of some parents, especially for those of the teen girls. They mainly worry about some facts like \"Edward, the vampire of the story, has possessive personality, human interests, and always gets angry easily or stalks Bella. He even sneaks into her house to watch her sleep before they start dating\". So, in many people\'s points of view, Twilight should be read under the guidance of adults, especially for teenagers who are under 18.\r\n');
INSERT INTO `ebooks` (`ebook_id`, `ebook_title`, `front_cover`, `author`, `genre_id`, `genre`, `published_year`, `ratings`, `abstract`) VALUES
(7, 'Atonement', , 'Ian Mcewan', '2', 'Fiction and Literature', 2001, '★★★★★', 'THE PLAY—for which Briony had designed the posters, programs, and tickets, constructed the sales booth out of a folding screen tipped on its side, and lined the collection box in red crêpe paper —was written by her in a two-day tempest of composition, causing her to miss a breakfast and a lunch. When the preparations were complete, she had nothing to do but contemplate her finished draft and wait for the appearance of her cousins from the distant north. There would be time for only one day of rehearsal before her brother arrived. At some moments chilling, at others desperately sad, the play told a tale of the heart whose message, conveyed in a rhyming prologue, was that love which did not build a foundation on good sense was doomed. The reckless passion of the heroine, Arabella, for a wicked foreign count is punished by ill fortune when she contracts cholera during an impetuous dash toward a seaside town with her intended.');
INSERT INTO `ebooks` (`ebook_id`, `ebook_title`, `front_cover`, `author`, `genre_id`, `genre`, `published_year`, `ratings`, `abstract`) VALUES
(8, 'The River Between', , 'Ngungi Wathiong', '2', 'Fiction and Literature', 1965, '★★★★★', 'My first encounter with Ngugi wa Thiong’o’s writing came relatively late for a person who considers himself a student of African literature. A friend of mine, a painter from South Africa, left a copy of Ngugi’s essay collection Decolonizing the Mind: The Politics of Language in African Literature in my apartment with the instruction to read it if I wanted to “free my mind.”');
INSERT INTO `ebooks` (`ebook_id`, `ebook_title`, `front_cover`, `author`, `genre_id`, `genre`, `published_year`, `ratings`, `abstract`) VALUES
(9, 'Rich Dad Poor: Rich Dad\\\'s Prophecy', , 'Kiyosaki, Robert T.', '2', 'Fiction and Literature', 2002, '★★★★☆', 'April 2017 marks 20 years since Robert Kiyosaki’s Rich Dad Poor Dad first made waves in the Personal Finance arena. It has since become the #1 Personal Finance book of all time. translated into dozens of languages and sold around the world.  Rich Dad Poor Dad is Robert\'s story of growing up with two dads his real father and the father of his best friend, his rich dad, and how both men shaped his thoughts about money and investing.');
INSERT INTO `ebooks` (`ebook_id`, `ebook_title`, `front_cover`, `author`, `genre_id`, `genre`, `published_year`, `ratings`, `abstract`) VALUES
(10, 'Ugly Love', , 'Colleen Hoover', '2', 'Fiction and Literature', 2014, '★★★★☆', '“Somebody stabbed you in the neck, young lady.” My eyes widen, and I slowly turn toward the elderly gentleman standing at my side. He presses the up button on the elevator and faces me. He smiles and points to my neck. “Your birthmark,” he says. My hand instinctively goes up to my neck, and I touch the dime-sized mark just below my ear. “My grandfather used to say the placement of a birthmark was the story of how a person lost a battle in their past life.');
INSERT INTO `ebooks` (`ebook_id`, `ebook_title`, `front_cover`, `author`, `genre_id`, `genre`, `published_year`, `ratings`, `abstract`) VALUES
(11, 'Beacon Technologies', , 'Stephen Statler', '3', 'Computers', 2016, '★★★★★', 'You have in your hands a brilliant and informative resource written by a true thought leader in our industry. Having had a prime seat at the table as an early navigator in the space, I’ve watched Stephen lead the way, and I’m deeply honored to be able to introduce what I hope will help propel you into the bright and promising future of the ecosystem.');
INSERT INTO `ebooks` (`ebook_id`, `ebook_title`, `front_cover`, `author`, `genre_id`, `genre`, `published_year`, `ratings`, `abstract`) VALUES
(12, 'Hacking Beginner to Expert Guide', , 'James Patterson', '3', 'Computer', 2020, '★★★★★', 'Hacking: Beginner to Expert Guide to Computer Hacking, Basic Security, and Penetration Testing (Computer Science Series) Whenever you encounter the word hacking, you probably associate it with sending an encrypted program to another user, and then being able to get unauthorized access on a remote computer.');
INSERT INTO `ebooks` (`ebook_id`, `ebook_title`, `front_cover`, `author`, `genre_id`, `genre`, `published_year`, `ratings`, `abstract`) VALUES
(13, 'Data Structure with Java', , 'John R. Hubbard', '3', 'Computer', 2004, '★★★★☆', 'Like other Schaum’s Outlines, this book is intended to be used primarily for self-study. It is suitable as a study guide in a course on data structures using the Java programming language. In American universities, this is typically the second course in the computer science major.\r\nThe book is also serving well as a reference on data structures and the Java Collections Framework. The book includes more than 200 detailed examples and over 260 solved problems. The author firmly believes that programming is learned best by practice, following a well-constructed collection of examples with complete explanations.\r\n');
INSERT INTO `ebooks` (`ebook_id`, `ebook_title`, `front_cover`, `author`, `genre_id`, `genre`, `published_year`, `ratings`, `abstract`) VALUES
(14, 'Foundation of Python Network Programming', , 'Brandon Rhodes & John Goerzen', '3', 'Computer', 2014, '★★★★★', 'It is an exciting moment for the Python community. After two decades of careful innovation that saw the language gain features such as context managers, generators, and comprehensions in a careful balance with its focus on remaining simple in both its syntax and its concepts, Python is finally taking off.\r\nInstead of being seen as a boutique language that can be risked only by top-notch programming shops such as Google and NASA,  Python is now experiencing rapid adoption, both in traditional programming roles, such as web application design, and in the vast world of “reluctant programmers,” such as scientists, data specialists, and engineers people who learn to program not for its own sake but because they must write programs if they are to make progress in their field.\r\n');
INSERT INTO `ebooks` (`ebook_id`, `ebook_title`, `front_cover`, `author`, `genre_id`, `genre`, `published_year`, `ratings`, `abstract`) VALUES
(15, 'Computability, Complexity, and Languages', , 'Davis Martin', '3', 'Computer', 1983, '★★★★☆', 'It is a pleasure to acknowledge the help we have received. Charlene Herring, Debbie Herring, Barry Jacobs, and Joseph Miller made their student classroom notes available to us. James Cox, Keith Harrow, Steve Henkind, Karen Lemone, Colm O\'Dunlaing, and James Robinett provided helpful comments and corrections. Stewart Weiss was kind enough to redraw one of the figures. Thomas Ostrand, Norman Shulman, Louis Salkind, Ron Sigal, Patricia Teller, and Elia Weixelbaum were particularly generous with their time and devoted many hours to helping us.');
INSERT INTO `ebooks` (`ebook_id`, `ebook_title`, `front_cover`, `author`, `genre_id`, `genre`, `published_year`, `ratings`, `abstract`) VALUES
(16, 'Modeling Structured Finance Cash Flows with Microsoft Excel', , 'Keith A. Allman', '4', 'General', 2007, '★★★★★', 'During my first analytics position after graduate school, I asked a vice president at our company what the best way was to learn how his group modeled transactions. He answered with a grin: ‘‘Trial by fire.’’ From that point on, I could not have counted the gray hairs that I developed trying to figure out the most precise and efficient method of modeling a transaction.');
INSERT INTO `ebooks` (`ebook_id`, `ebook_title`, `front_cover`, `author`, `genre_id`, `genre`, `published_year`, `ratings`, `abstract`) VALUES
(17, 'The New Confessions of an Economic Hitman', , 'John Perkins', '4', 'General', 2016, '★★★★☆', 'Praise for The New Confessions of an Economic Hit Man “When I read Confessions of an Economic Hit Man, I could not have known that, some years later, I would be on the receiving end of the type of ‘economic hit’ that Perkins so vividly narrated. This book resonates with my experiences of the brutish methods and gross economic irrationality guiding powerful institutions in their bid to undermine democratic control over economic power. Perkins has, once again, made a substantial contribution to a world that needs whistle-blowers to open its eyes to the true sources of political, social, and economic power.”');
INSERT INTO `ebooks` (`ebook_id`, `ebook_title`, `front_cover`, `author`, `genre_id`, `genre`, `published_year`, `ratings`, `abstract`) VALUES
(18, 'An Introduction to Feng Shui', , 'Ole Bruun', '4', 'General', 2008, '★★★☆☆', 'Feng Shui (which is pronounced ‘Fung Shway’) is an ancient Chinese practice that has been around for thousands of years, and which involves art and science. The practice relies on the laws of heaven and earth to help people balance their energies or \'Chi\' within a space, help them become and stay healthy, and receive good fortune. The word ‘Feng’ means wind and ‘Shui’ means water. Local Chinese people place wind that is gentle and water that is clear in one setting to represent good health and harvest.');
INSERT INTO `ebooks` (`ebook_id`, `ebook_title`, `front_cover`, `author`, `genre_id`, `genre`, `published_year`, `ratings`, `abstract`) VALUES
(19, 'Accounting Principles', , 'Jerry J. Weygandt', '4', 'General', 1987, '★★★★★', 'E-commerce changed into visible as a fad or gimmick whilst the pioneers of the system began. Certainly, being tied to a pc display to make a buy you\'ll want to watch for wouldn’t hold the hobby of clients. Yet inroads were made, and sales were performed. One of the triumphing difficulties related to early online transactions turned into the protection of private monetary facts. As hackers receive get entry to non-encrypted facts it becomes a rallying factor for lots of e-commerce businesses. There needed to be a better way to do online commercial enterprise.\r\n');
INSERT INTO `ebooks` (`ebook_id`, `ebook_title`, `front_cover`, `author`, `genre_id`, `genre`, `published_year`, `ratings`, `abstract`) VALUES
(20, 'Debt-Free Network Marketing', , 'Ben Greene', '4', 'General', 2016, '★★★★☆', 'The Publisher has strived to be as correct and entire as feasible in the creation of this file, notwithstanding the truth that he does not warrant or constitute at any time that the contents inside are correct due to the rapidly changing nature of the Internet.\r\nWhile all attempts have been made to verify the records provided in this guide, the Publisher assumes no duty for mistakes, omissions, or contrary interpretations of the situation remembered herein. Any perceived slights of precise individuals, people, or companies are unintended.');
INSERT INTO `ebooks` (`ebook_id`, `ebook_title`, `front_cover`, `author`, `genre_id`, `genre`, `published_year`, `ratings`, `abstract`) VALUES
(21, 'The Basics of Finance', , 'Pamela Peterson Drake and Frank J. Fabozzi', '5', 'Finance', 2010, '★★★★☆', 'What Is Finance? A truly great business must have an enduring ‘moat’ that protects excellent returns on invested capital. The dynamics of capitalism guarantee that competitors will repeatedly assault any business ‘castle’ that is earning high returns. Therefore, a formidable barrier such as a company’s being a low-cost producer (GEICO, Costco) or possessing a powerful worldwide brand (Coca-Cola, Gillette, American Express) is essential for sustained success. Business history is filled with ‘Roman Candles,’ companies whose moats proved illusory and were soon crossed. —Warren Buffett, Letter to Shareholders of Berkshire Hathaway, February 2008.');
INSERT INTO `ebooks` (`ebook_id`, `ebook_title`, `front_cover`, `author`, `genre_id`, `genre`, `published_year`, `ratings`, `abstract`) VALUES
(22, 'Financing Real Estate Investments', , 'Ralph R. Roberts & Chip Cummings', '5', 'Finance', 2009, '★★★★★', 'Real estate investing is an expensive habit. You need money to finance the purchase, renovate your fixer-upper, and cover the holding costs while you prepare to sell or rent the property. The good news is that it doesn’t all have to be your money. The less of your own money you can use and the more you can borrow, the bigger the return on your investment. Add the potential credit and market woes like the first decade of the 2000s, and investing in real estate also becomes a bit more of an adventure.');
INSERT INTO `ebooks` (`ebook_id`, `ebook_title`, `front_cover`, `author`, `genre_id`, `genre`, `published_year`, `ratings`, `abstract`) VALUES
(23, 'Personal Finance', , 'Rachel Siegel', '5', 'Finance', 2009, '★★★★☆', 'Take charge of your finances. Procrastinating is detrimental to your long-term financial health. Don’t wait for a crisis or major life event to get your act together. Read this book and start implementing a plan now! Don’t buy consumer items (cars, clothing, vacations, and so on) that lose value over time on credit. Use debt only to make investments in things that gain value, such as real estate, a business, or an education.');
INSERT INTO `ebooks` (`ebook_id`, `ebook_title`, `front_cover`, `author`, `genre_id`, `genre`, `published_year`, `ratings`, `abstract`) VALUES
(24, 'Advances in Quantitative Analysis of Finance and Accounting', , 'Cheng-Few Lee', '5', 'Finance', 1991, '★★★★★', 'Introduction Emerging markets have been exposed to remarkable market risks and it is by now folk wisdom that, if given a choice, they should be endowed with instruments of hedging against downside risks (see Caballero, 2003; Caballero and Panaceas, 2003; Shiller, 2003).\r\nFinding out which factors are the fundamental source of volatility for each country — for example, the prices of oil for Mexico, of coffee for Brazil, of semiconductors for Korea, of copper for Chile, and so on — is recognized as a crucial step to construct the appropriate hedging instruments, which will be contingent on observable variables (Caballero, 2003). Yet, it remains to be answered the question concerning the proper application of derivative securities that can be used to construct hedging strategies and the optimal hedging policy.\r\n');
INSERT INTO `ebooks` (`ebook_id`, `ebook_title`, `front_cover`, `author`, `genre_id`, `genre`, `published_year`, `ratings`, `abstract`) VALUES
(25, 'FINANCE: Advance Modeling', , 'Mary Jackson & Mike Staunton', '5', 'Finance', 2001, '★★★★★', 'We hope that our text, Advanced Modelling in Finance, is conclusive proof that a wide range of models can now be successfully implemented using spreadsheets. The models range across the complete spectrum of finance including equities, equity options, and bond options spanning developments from the early fifties to the late nineties.\r\nThe models are implemented in Excel spreadsheets, complemented with functions written using the VBA language within Excel. The resulting user-defined functions provide a portable library of programs with more than sufficient speed and accuracy. Advanced Modelling in Finance should be viewed as a complement (or dare we say, an antidote) to traditional textbooks in the area. It contains relatively few derivations, allowing us to cover a broader range of models and methods, with particular emphasis on more recent advances.\r\n');

